import React from "react";
import awsCert from '../images/aws_developer.png';
import azureCert from '../images/azure-security-engineer-associate600x600.png';
import lumaCert from '../images/luma_badge.png';
import scrumCert from '../images/professional_scrum_master.webp';


export default function Certifications(){
  return(
    <div className="certifications">
      <img src={awsCert}/>
      <img src={azureCert}/>
      <img src={awsCert}/>
      <img src={awsCert}/>
      <h2>Certifications</h2>
      <p>AWS Certified Developer Associate</p>
      <p>Microsoft Certified Azure Security Engineer Associate</p>
      <p>LUMA Certified Facilitator of Human-Centered Design</p>
      <p>Professional Scrum Master I (Scrum.org)</p>
    </div>
  )
}
